  false,\n\t\"url\": null,\n\t\"notes\": \"This map service displays 2011 USEPA National
  Emissions Inventory (NEI) point facility information for the United States. The
  map service was created for inclusion in the USEPA Community/Tribal-Focused Exposure
  and Risk Screening Tool (C/T-FERST) mapping application (https://www.epa.gov/c-ferst)
  and displays several NEI pollutants (Acetaldehyde, Acrolein, Arsenic, Benzene, 1,3-Butadiene,
  Chromium, Diesel PM, Formaldehyde, Lead, Naphthalene, and PAH). The NEI is a comprehensive
  inventory of air emissions of both criteria air pollutants (CAPs) and hazardous
  air pollutants (HAPs) from all air emission sources for the United States. The NEI
  is prepared every three years by the USEPA based primarily on emission estimates
  and emission model inputs provided by state, local, and tribal air agencies for
  sources in their jurisdictions and supplemented by data developed by the USEPA.
  For more information about the 2011 NEI data, go to: https://www.epa.gov/air-emissions-inventories/national-emissions-inventory
  and https://www.epa.gov/air-emissions-inventories/2011-national-emissions-inventory-nei-data.\",\n\t\"license_title\":
